/*1.Write a query to return email, first name, last name & gener of all rock music listner. return  your list order
alphabetically by email starting with A?*/

Quary:
select email,first_name,last_name from customer
join invoice ON customer.customer_id = invoice.customer_id
join invoice_line ON invoice.invoice_id = invoice_line.invoice_id
where track_id IN(select track_id from track join genre on track.genre_id=genre.genre_id
				  where genre.name Like 'Rock')
	order by email 

