/*2. Lets invite the artist who have written the most rock music in our data base. write a query that 
return artist name and total track count of the 10 rock brand?*/

Quary:

select artist.artist_id,artist.name, count(artist.artist_id) as number_of_songs from artist
join album on artist.artist_id = album.artist_id
join track on album.album_id=track.album_id
join genre on track.genre_id = genre.genre_id
where genre.name like 'Rock'
group by artist.artist_id
order by number_of_songs desc limit 10

